import React from 'react';
import { useLocation, Link } from 'react-router-dom';
import './passedCourses.css';

const PassedCourses = () => {
  const location = useLocation();
  const { passedCourses } = location.state || { passedCourses: [] };

  return (
    <div className="passed-courses">
      <h1>Valid Course Attempts</h1>
      {passedCourses.length > 0 ? (
        <ul>
          {passedCourses.map((course, index) => (
            <li key={index}>
              <strong>{course.code}</strong>: {course.description} - Grade: {course.grade}
            </li>
          ))}
        </ul>
      ) : (
        <p>No passed courses found.</p>
      )}
      <Link to="/" className="back-link">Reenter my transcript</Link>
    </div>
  );
};

export default PassedCourses;
